pragma solidity ^0.7;

import "OpenZeppelin/openzeppelin-contracts@3.4.0/contracts/access/Ownable.sol";
import "OpenZeppelin/openzeppelin-contracts@3.4.0/contracts/token/ERC721/ERC721.sol";
import "OpenZeppelin/openzeppelin-contracts@3.4.0/contracts/utils/ReentrancyGuard.sol";

interface IMetadata {
    function size() external view returns(uint256);
    function simulacra() external view returns(address);
    function ipfsTokenURI(uint256 _tokenID) external view returns(string memory);
}

contract Simulacra is ERC721, Ownable, ReentrancyGuard {

    event Commission(
        address indexed buyer,
        uint256 indexed tokenId,
        uint256 artists
    );

    string constant NAME = "Toy";  // FIXME
    string constant SYMBOL = "TOY";  // FIXME

    uint256 internal constant _MAX_SIMULACRA = 3447;
    uint256 public constant MAX_ARTISTS = 44;  // FIXME: 45?

    uint256 public immutable SALE_START;
    uint256 public immutable SALE_END;
    uint256 public immutable MINT_DEADLINE;

    IMetadata metadata;
    string constant EMPTY_SIMULACRA_IPFS_URL = "https://ipfs.io/ipfs/Qmb6tuZCf2pNwNWPgHeUCk7Y1wZt9zDTXX8uMr57cvV2Jf";
    string constant SIMULACRA_METADATA_IPFS_URL = "https://pastebin.com/raw/YVBNip5u"; // FIXME

    constructor(uint256 _saleStartTimestamp, uint8 _saleDurationInDays, uint8 _failsafeDurationInDays)
        ERC721(NAME, SYMBOL) {

        SALE_START = _saleStartTimestamp;
        uint256 sale_end = _saleStartTimestamp + (_saleDurationInDays * 1 days);
        SALE_END = sale_end;        
        MINT_DEADLINE = sale_end + (_failsafeDurationInDays * 1 days);
    }

    /*
    * Status functions
    */

    function artSoldOut() public view returns (bool){
        return totalSupply() >= MAX_SIMULACRA();
    }

    function artWasRevealed() public view returns(bool){
        return address(metadata) != address(0)          // metadata is not null ... 
            && metadata.simulacra() == address(this)    // ... and it's associated to the Simulacra contract
            && metadata.size() == totalSupply();        // ... and its size matches the total supply.
    }

    function isInRefundMode() public view returns(bool){
        return block.timestamp > MINT_DEADLINE && !artWasRevealed();
    }

    function MAX_SIMULACRA() public virtual pure returns(uint256){
        return _MAX_SIMULACRA;
    }

    /*
    * Pricing functions
    */

    function getCurrentPrice() public view returns(uint256){
        require(SALE_START <= block.timestamp && block.timestamp <= SALE_END); // dev: Sale is closed
        require(!artSoldOut()); // dev: No more pieces to sell
        uint256 nextItemAvailable = totalSupply();
        return getPriceOf(nextItemAvailable);
    }

    function getPriceOf(uint256 _tokenID) public virtual pure returns(uint256){       
        if (_tokenID < 55){
            return 111111111111111111;  // 0.111111111111111111 ETH
        } else if (_tokenID < 610) {
            return 333333333333333333;  // 0.333333333333333333 ETH
        } else if (_tokenID < 1721) {
            return 666666666666666666;  // 0.666666666666666666 ETH
        } else if (_tokenID < 2832) {
            return 1000000000000000000;  // 1 ETH
        } else if (_tokenID < 3387) {
            return 3000000000000000000;  // 3 ETH
        } else if (_tokenID < 3442) {
            return 11000000000000000000;  // 11 ETH
        } else if (_tokenID < 3447){
            return 111000000000000000000;  // 111 ETH
        } else {
            revert();
        }
    }

    function remainingAtCurrentPrice() public virtual view returns(uint256){
        uint256 piecesSold = totalSupply();
        uint256 nextStepAt;
        if (piecesSold < 55){
            nextStepAt = 55;
        } else if (piecesSold < 610) {
            nextStepAt = 610;
        } else if (piecesSold < 1721) {
            nextStepAt = 1721;
        } else if (piecesSold < 2832) {
            nextStepAt = 2832;
        } else if (piecesSold < 3387) {
            nextStepAt = 3387;
        } else if (piecesSold < 3442) {
            nextStepAt = 3442;
        } else if (piecesSold < 3447){
            nextStepAt = 3447;
        } else {
            return 0;
        }
        return nextStepAt - piecesSold;
    }

    /*
    * Transactions
    */

    function commissionPieces(uint256 _indices, uint256 _number) public payable nonReentrant {
        // Check sale is valid (note that call to getCurrentPrice below also makes additional checks)
        require(0 < _number && _number <= remainingAtCurrentPrice()); // dev: Invalid number

        // Check the price is right
        require(msg.value == _number * getCurrentPrice()); // dev: Invalid eth amount

        // Check popularity indices
        require(uint8(_indices) <= MAX_ARTISTS);  // dev: 1st artist index is not valid
        require(uint8(_indices >> 8) <= MAX_ARTISTS);  // dev: 2nd artist index is not valid
        require(uint8(_indices >> 16) <= MAX_ARTISTS);  // dev: 3rd artist index is not valid

        // Mint the NFTs
        uint256 baseTokenID = totalSupply();
        for(uint i=0; i < _number; i++){        
            uint256 tokenID = baseTokenID + i;
            _safeMint(msg.sender, tokenID);
            emit Commission(msg.sender, tokenID, _indices);
        }
    }

    function reveal(address _metadata) public onlyOwner {
        require(block.timestamp <= MINT_DEADLINE); // dev: You can only reveal before the deadline
        require(SALE_END <= block.timestamp || artSoldOut()); // dev: Either sale period must have ended or all pieces are sold out
        metadata = IMetadata(_metadata);
        require(artWasRevealed()); // dev: You need to provide a valid metadata contract
    }

    /**
     * @dev Withdraw ETH from this contract. Only owner can call it.
    */
    function withdraw() onlyOwner public {
        require(artWasRevealed()); // dev: Can't withdraw until art is revealed
        uint balance = address(this).balance;
        msg.sender.transfer(balance);
    }

    function getRefund(uint256 _tokenID) public nonReentrant {
        require(isInRefundMode()); // dev: Refunds are only available when the contract is in refund mode
        require(msg.sender == ownerOf(_tokenID));  // dev: Only the token owner can get a refund

        uint256 price = getPriceOf(_tokenID);
        _burn(_tokenID);

        msg.sender.transfer(price);
    }

    /*
    * Metadata
    */
    function tokenURI(uint256 _tokenID) public view override returns(string memory){
        require(_exists(_tokenID)); // dev: This _tokenID doesn't exist

        if (artWasRevealed()){
            return metadata.ipfsTokenURI(_tokenID);
        } else {
            return EMPTY_SIMULACRA_IPFS_URL; // FIXME: Maybe revert instead?
        }
    }

    function contractURI() public view returns (string memory) {
        return SIMULACRA_METADATA_IPFS_URL;
    }
}
